import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [bicycles, setBicycles] = useState([]); // State to store bicycles

  useEffect(() => {
    // Fetch data from backend
    axios.get('http://localhost:8081/bicycles')  // Ensure correct API endpoint
      .then(response => {
        console.log('Fetched bicycles:', response.data); // Log the data to console
        setBicycles(response.data);  // Store data in state
      })
      .catch(error => {
        console.error('Error fetching bicycles:', error);
      });
  }, []); // Empty dependency array ensures it runs once when the component mounts

  return (
    <div>
      <h1>Bicycles</h1>
    /*  {/* Display raw data */}
    */  <pre>{JSON.stringify(bicycles, null, 2)}</pre>

      <ul>
        {bicycles.length > 0 ? (
          bicycles.map(bicycle => (
            <li key={bicycle.bicycleID}>
              <strong>Type:</strong> {bicycle.bicycleType || 'Unknown'}<br />
              <strong>Short Description:</strong> {bicycle.bicycleShortDescription || 'Not provided'}<br />
              <strong>Long Description:</strong> {bicycle.bicycleLongDescription || 'Not provided'}<br />
              <strong>Status:</strong> {bicycle.bicycleStatus || 'Unknown'}<br />
            </li>
          ))
        ) : (
          <p>No bicycles available.</p>
        )}
      </ul>
    </div>
  );
};

export default App;
